import "./App.css";
import Home from "./landingComponents/Home";
import About from "./landingComponents/About";
import Work from "./landingComponents/Work";
import Testimonial from "./landingComponents/Testimonial";
import Contact from "./landingComponents/Contact";
import Footer from "./landingComponents/Footer";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import User from "./landingComponents/User";
import Register from "./pages/Register";
import Login from "./pages/Login";




function App() {
  return (
    <div className="App">


    <Router>
    <Home />
      <About />
      <Work />
      <Testimonial />
      <Contact />
      <Footer />
      <Routes>
        <Route exact path="/register" element={<Register/>}/> 
        <Route exact path="/login" element={<Login/>}/> 
        <Route exact path="/home" element={<User/>}/> 
      </Routes>
      </Router>
    </div>
  );
}

export default App;
